function ImageSection() {

	return (
		<section className="">
			<img id="resume-pic" src="Profile_Pic_Wide.jpg" alt="Drew Bowman"></img>
			<div className="absolute flex items-center justify-center text-white top-96 right-16 p-2 rounded-md bg-lime-800 bg-opacity-75">
				<h3 
					className="opacity-100 text-3xl text-white font-serif"
				>
					<strong>Hi, I'm Drew Bowman.</strong> <br/>
					I'm a software engineer <br/> helping businesses create <br/> beautiful and functional websites.
				</h3>
			</div>
		</section>
	);
}

export default ImageSection;
